import React from "react";
import './Header.css'

function Header() {
    return (
        <div className='header-container'>
            <div className="header-parent">
                <div className="header-hamburger">

                </div>
                <div className="header-logo">
                    <span>NVARD</span>
                </div>
                <div className="header-options">

                </div>
            </div>
        </div>
    );
}

export default Header;
